document.addEventListener("DOMContentLoaded",function(){var e=[].slice.call(document.querySelectorAll("img:not([loading])"));if("IntersectionObserver"in window){let t=new IntersectionObserver(function(e,n){e.forEach(function(e){if(e.isIntersecting){let n=e.target;n.src=n.dataset.src||n.src,n.loading="lazy",t.unobserve(n)}})});e.forEach(function(e){t.observe(e)})}});
